fullText:
@MuskUniversity Entropy, entropy, 
No escaping
That for me.

I am excited to welcome Linda Yaccarino as the new CEO of Twitter!

@LindaYacc will focus primarily on business operations, while I focus on product design &amp; new technology.

Looking forward to working with Linda to transform this platform into X, the everything app.

@EdKrassen @TuckerCarlson On this platform, unlike the one-way street of broadcast, people are able to interact, critique and refute whatever he or anyone may say. 

And, of course, anything misleading will get @CommunityNotes. 

I also want to be clear that we have not signed a deal of any kind

@gannonbreslin Yeah. 

Or that WhatsApp founders left Meta/Facebook in disgust, started #deletefacebook campaign &amp; made major contributions to building Signal. 

What they learned about Facebook &amp; changes to WhatsApp obviously disturbed them greatly.

@WallStreetSilv It won‚Äôt get easier to pay down the debt. 

As debt rises for countries, interest payments consume a larger part of the budget, until there is little room for anything else. 

TANSTAAFL

@ICannot_Enough @engineers_feed Yeah, it‚Äôs insane! Roughly 70% of Earth is ocean and most of the ocean has zero ships per Starlink cell. 

Most people think Earth is crowded with humans, but in reality it‚Äôs almost empty by surface area. Humans congregate in a very small percentage of Earth (cities).

The entire

@EvaVlaar True. What‚Äôs actually happening in most countries is population collapse! 

Very important to make new humans. 

No new humans means no humanity.

@stats_feed This is incorrect. The de facto US national income tax is 40%. When added to California state income tax, it is 53%.

That means the state confiscates a majority of your income. But hey, at least they‚Äôre fixing the potholes, right?

If you then give money to a person beyond the

@EdKrassen People definitely shouldn‚Äôt be attacked for doing good. Is it really just a question of money to restore hearing?

I‚Äôm always looking ways to donate money that are actually good. Perhaps this is one. 

It is very hard to donate money if you about it doing actual good, not merely

@TimSweeneyEpic @TitterDaily My observation of the notes is that they are insightful &amp; accurate. 

They‚Äôre most effective against high profile publications &amp; people, where reply debates are less effective.

Please lmk if you see a note that was unhelpful or wrong.

@SethDillon Ending censorship in guise of virtue, handing control of the narrative to the people and actually accurate fact-checking are essential goals.

Naturally, those who used to control the narrative and censored views they disliked are less than thrilled. 

How tragic.

@realMeetKevin @Tesla Always tough with margins for new vehicle lines, especially when there are major technology shifts. 

I think Ford‚Äôs overall strategy with EVs is smart.

The electric F-150 (Lightning) has high demand.

@westcoastbill @Twitter Nice work by the recommendations algorithm team!

As always, changes will be open source. 

So far, over 1M lines of code have been uploaded to our GitHub repository.

@ighaworth The power of @CommunityNotes to combat actual disinformation is incredible. 

At its core, it requires people with diverse viewpoints to agree that a note is valid before it is shown.

Very hard to game and fully open source.

@Timcast Go woke, go ‚Ä¶

It‚Äôs been a while since they made quality content. 

https://t.co/8uplyQrlnS

@LHSummers @federalreserve @DavidWestin @BloombergTV Fed data has too much latency. Mild recession is already here. 

It‚Äôs not like just the canary in the coal mine (SVB) died, one of the staunchest miners (Credit Suisse) died too &amp; the cemetery is filling up fast!

Further rate hikes will trigger severe recession. Mark my words.

@MacGraeme42 @Anc_Aesthetics @CommunityNotes As more note reviewers from a particular viewpoint pile on, the weight of their note review decreases, thus counteracting brigade / dogpile attacks.

Everything is open source &amp; critique is welcome. 

https://t.co/yXgicam3Gz

Anyone making materially false statements on this platform will get Community Noted, including you, me, Tucker, advertisers, head of state, etc. No exceptions. 

Convince the people and let the chips fall where they may. 

@CommunityNotes

@krassenstein @ZubyMusic Comprehensive study in Sweden shows *increased* suicide!

Death for sex-reassigned persons was higher than for controls of same birth sex, particularly death from suicide. They also had increased risk for suicide attempts and psychiatric inpatient care. 

https://t.co/hIakkEJvJb

@ErcXspace @SpaceX Gravity, gravity, 
time to escape 
that for me

@SciGuySpace 3 months ago, we started building a massive water-cooled, steel plate to go under the launch mount. 

Wasn‚Äôt ready in time &amp; we wrongly thought, based on static fire data, that Fondag would make it through 1 launch.

Looks like we can be ready to launch again in 1 to 2 months.

@Anc_Aesthetics Sorry about this. Yes, subscribe now via web or wait a few days for Apple to approve. 

Note: creator gets ~92% of subscription for web subscribers (Stripe &amp; CC fees are ~8%), but only 70% on iOS/Android. 

Twitter keeps nothing. All funds we receive go to the content creator.

@AlecStapp Germ theory took a shockingly long time to be accepted! The entire medical establishment was against it for centuries.

Von Leeuwenhoek's 1677 ‚Äòletter on the protozoa‚Äô was verified by The Royal Society.

https://t.co/ESLAcyFiRR

@SmokeAwayyy With booster ultimately flying up to ~20 times per day &amp; ship flying up to ~5 times per day. 

Useful load to Mars is ~150 metric tons, but requires ~5 orbital refilling tanker flights.

Target: &gt;1 megaton of cargo &amp; people delivered to Mars, so that it becomes self-sustaining.

@KanekoaTheGreat Almost no one among the cognoscenti even knows this. 

Why does our western press insist on pushing such a lopsided view of the conflict? 

They must either think that the public is too dumb to understand nuance or the press themselves lack a deep understanding.

@KnowledgeArchiv The Roman corvus, invented for the Battle of Mylae, would probably have been faster. 

Carthage thought they had the best fleet. Their overconfidence led to their defeat.

https://t.co/PyV5rhG2pO

@DavidSacks @VivekGRamaswamy @GregAbbott_TX Yeah, wrong on many levels. Tesla is increasing production rapidly in Texas, California &amp; Nevada.

Our competitors require subsidies, not us. That said, if competitors get subsidies, Tesla should get them too.

Tesla‚Äôs competitive position would improve if all subsidies ended.

@WholeMarsBlog We need to predict what pedestrians will do based on their behavior, including limb angle &amp; direction of sight. 

FSD currently sees all pedestrians as cuboids, so is overly cautious.

Also, diffusion seems to be more compute-efficient than transformers for vision.

@BretWeinstein 1. Substack links were never blocked. Matt‚Äôs statement is false. 

2. Substack was trying to download a massive portion of the Twitter database to bootstrap their Twitter clone, so their IP address is obviously untrusted.

3. Turns out Matt is/was an employee of Substack.

@kaschuta What is surprising is that so few people realize this.

Individuals should always wonder who wrote the software running in their head. 

Don‚Äôt be an NPC.

@jakeshieldsajj Very sorry to hear that. Many people I know have been severely assaulted.

Violent crime in SF is horrific and even if attackers are caught, they are often released immediately.

Is the city taking stronger action to incarcerate repeat violent offenders @BrookeJenkinsSF?

@TitterDaily Avoiding dystopian outcomes is not easy. 

The intent is not for the algorithm to be some judgy moral arbiter, but rather that it do its best to inform &amp; entertain.

Trying to maximize unregretted user-minutes seems like the right objective.

